$(function(){
    var vocabItem = $('.vocab__item');
    var vocabThumb = $('.vocab__thumb-link');

    $(vocabThumb).on('click', function(){
        vocabId = $(this).data('vocabId');
        window.location.href = '/vocabs/' + vocabId;
    });

    $(vocabItem).on('click', function(){
        vocabId = $(this).data('vocabId');
        window.location.href = '/vocabs/' + vocabId;
    });

});
